(113, '118.	Which of the following statement is correct about the program given below?\r\n#include<iostream.h> \r\nint i, j; \r\nclass IndiaBix\r\n{\r\n    public:\r\n    IndiaBix(int x = 0, int y = 0)\r\n    {\r\n        i = x; \r\n        j = x; \r\n        Display();\r\n    }\r\n    void Display()\r\n    {\r\n        cout<< j <<" ";\r\n    } \r\n}; \r\nint main()\r\n{\r\n    IndiaBix objBix(10, 20); \r\n    int &s = i; \r\n    int &z = j; \r\n    i++;\r\n    cout<< s-- << " " << ++z; \r\n    return 0; \r\n}\r\n\r\n', 'The program will print the output 0 11 21.', 'The program will print the output 10 11 11.', 'The program will print the output 10 11 21.', 'The program will print the output 10 11 12', 'The program will print the output 10 11 11.'),
