(316, 'What is the length of a running train?\r\nI. The train crosses a man in 9 seconds.\r\nII. The train crosses a 240 metre long platform in 24 seconds.', 'II alone sufficient while I alone not sufficient to answer', 'Either I or II alone sufficient to answer', 'Both I and II are not sufficient to answer', 'Both I and II are necessary to answer', 'Both I and II are necessary to answer'),
