INSERT INTO `medium_question` (`ques_id`, `ques`, `option1`, `option2`, `option3`, `option4`, `answer`) VALUES
(1, 'For 16-bit compiler allowable range for integer constants is\r\n', '3.4e38 to 3.4e38', '-32767 to 32768', '32668 to 32667', '32768 to 32767', '32768 to 32767'),
(2, 'A  C variable cannot start with', 'A number', 'A special symbol', 'Both of the above', 'An alphabet', 'Both of the above'),
(3, 'If integer needs two bytes of storage, then maximum value of an unsigned integer is', '216 - 1', '215 - 1', '216', '215', '216 - 1'),
(4, 'What is the correct value to return to the operating system upon the successful completion of a program?', '1', '-1', '0', 'No return value', '0'),
(5, 'Which of following is not a valid name for a C variable?', 'Examveda', 'Exam_veda', 'Exam veda', 'none of the above', 'Exam veda'),
(6, '"My salary was increased by 15%" Select the statement, which will EXACTLY reproduce the line of text above.', 'printf("My salary was increased by 15/%!");', 'printf("My salary was increased by 15%!");', 'printf("My salary was increased by 15\'%\'!");', 'printf("My salary was increased by 15%%!");', 'printf("My salary was increased by 15%%!");'),
(7, 'short testarray[4][3] = { {1}, {2,3}, {4,5,6}};\r\nprintf("%d", sizeof(testarray));\r\nAssuming a short is two bytes long, what will be printed by the above code?\r\n', '6', '7', '12', '24', '24'),
(8, 'The maximum value that an integer constant can have is ? \r\n\r\n', '-32767', '32767', '1.7014e + 38', '-1.7014e + 38', '32767'),
(9, 'Which of the following is false in C ? ', 'Keywords cannot be used as variable names', 'Variable names can contain a digit', 'Variable names do not contain a blank space', 'Capital letters can be used in variable names', 'Keywords cannot be used as variable names'),
(10, 'On which if the following operator can % operator NOT be used ? ', 'int variable', 'float variable', 'int constant', 'all of the above', 'float variable'),
(11, 'The case keyword is followed by ? \r\n\r\n', 'float values', 'character values', 'int values', 'both b and c', 'both b and c'),
(12, 'Which of the following is not true in context of C language ? \r\n\r\n', 'It is array of characters', 'Last character of character array is always \\0', 'C inserts the null character automatically', 'both b and c', 'both b and c'),
(13, 'Which of the following operations can not be perform on pointers in C ? \r\n\r\n', 'Addition of two pointers', 'Subtraction of a number from a pointer', 'Subtraction of one pointer from another', 'Addition of a number to a pointer', 'Addition of two pointers'),
(14, 'Any program in C has access to three standard files? ', 'standard input file, standard output file, standard error file', 'stdin, stdout, stderr', 'keywords, screen, stderr', 'all the above', 'stdin, stdout, stderr'),
(15, 'An identifier in C  ? \r\n\r\n', 'is a name of thing such as variable and function \r\n\r\n', 'is made up of letters, numerals and the underscore', 'can contain both uppercase and lowercase letters', 'all the above', 'all the above'),
(16, 'What will the output of following program ?\r\n    #include<stdio.h>\r\n    void main( )\r\n    {\r\n         int i=0;\r\n         for(;i;)\r\n            printf("Allquiz");\r\n    }  \r\n\r\n', 'Prints nothing', 'Generates error', 'Garbage value', 'all the above', 'Prints nothing'),
(17, 'Which of the following function sets first n characters of a string to a given character?', 'strinit()', 'strnset()', 'strset()', 'strcset()', 'strnset()'),
(18, 'If the two strings are identical, then strcmp() function returns', '-1', '1', '0', 'all the above', '0'),
(19, 'How will you print \\n on the screen?', 'printf("\\n");', 'echo"\\\\n";', 'printf(\'\\n\');', 'printf("\\\\n");', 'printf("\\\\n");'),
(20, 'What are the types of linkages?', 'Internal and external', 'internal,external and none', 'external and none', 'internal', 'internal,external and none'),
(21, 'Is there any difference between following declarations?\r\n1 :	extern int fun();\r\n2 :	int fun();\r\n', 'Both are identical', 'No difference, except extern int fun(); is probably in another file', 'int fun(); is overrided with extern int fun();', 'none of these', 'No difference, except extern int fun(); is probably in another file'),
(22, 'Which of the following is not user defined data type?\r\n1 :	struct book\r\n{\r\n    char name[10];\r\n    float price;\r\n    int pages;\r\n};\r\n2 :	long int l = 2.35;\r\n3 :	enum day {Sun, Mon, Tue, Wed};\r\n', '1', '2', '3', 'both 1 and 2', '2'),
(23, 'Identify which of the following are declarations\r\n1 :	extern int x;\r\n2 :	float square ( float x ) { ... }\r\n3 :	double pow(double, double);\r\n', '1', '2', '1 and 3', '3', '1 and 3'),
(24, 'In the following program where is the variable a getting defined and where it is getting declared?\r\n#include<stdio.h>\r\nint main()\r\n{\r\n    extern int a;\r\n    printf("%d\\n", a);\r\n    return 0;\r\n}\r\nint a=20;\r\n', 'extern int a is declaration, int a = 20 is the definition', 'int a = 20 is declaration, extern int a is the definition', 'int a = 20 is definition, a is not defined', 'a is declared, a is not defined', 'extern int a is declaration, int a = 20 is the definition'),
(25, 'What will be the output of following code ?\r\n   #include<stdio.h>\r\n   void main( )\r\n   {\r\n        char suite =3;\r\n        switch(suite)\r\n        {\r\n               case 1: \r\n                        printf("ALL QUIZ");\r\n               case 2:\r\n                        printf("All quiz is great");\r\n               default:\r\n                        printf("All quiz contains MCQs");\r\n         }\r\n         printf("Are you like All quiz ?");\r\n   } \r\n     \r\n\r\n', 'ALL QUIZ', 'All quiz is great', 'All quiz contains mcqs', 'All quiz is great Are you like Al quiz ?', 'All quiz is great Are you like Al quiz ?'),
(26, 'Which of the following statements is correct?', 'Base class pointer cannot point to derived class.', 'Derived class pointer cannot point to base class.', 'Pointer to derived class cannot be created.', 'Pointer to base class cannot be created.', 'Derived class pointer cannot point to base class.'),
(27, 'Which of the following is not the member of class?', 'Static function', 'Friend function', 'Const function', 'Virtual function', 'Friend function'),
(28, 'Which of the following concepts means determining at runtime what method to invoke?', 'Data hiding', 'Dynamic Typing', 'Dynamic Binding', 'Dynamic Loading', 'Dynamic Binding'),
(29, 'Which of the following concept of oops allows compiler to insert arguments in a function call if it is not specified?', 'Call by value', 'Call by reference', 'Default arguments', 'Call by pointer', 'Default arguments'),
(30, 'How many instances of an abstract class can be created?', '1', '5', '13', '0', '0'),
(31, 'Which of the following cannot be friend?\n', 'Function', 'Class', 'Object', 'Operator Function', 'Object'),
(32, 'Why reference is not same as a pointer?', 'A reference can never be null.', 'A reference once established cannot be changed.', 'Reference doesn\'t need an explicit dereferencing mechanism.', 'All of the above.', 'All of the above.'),
(33, 'Which of the following concepts provides facility of using object of one class inside another class?', 'Encapsulation', 'Abstraction', 'Composition', 'Inheritance', 'Composition'),
(34, 'How many types of polymorphisms are supported by C++?', '1', '2', '3', '4', '2'),
(35, 'Which of the following is an abstract data type?', 'int', 'double', 'string', 'class', 'class'),
(36, 'Which of the following concepts means adding new components to a program as it runs?', 'Data hiding', 'Dynamic typing', 'Dynamic binding', 'Dynamic loading', 'Dynamic loading'),
(37, 'Which of the following statement is correct?', 'A constructor is called at the time of declaration of an object.', 'A constructor is called at the time of use of an object.', 'A constructor is called at the time of declaration of a class.', 'A constructor is called at the time of use of a class.', 'A constructor is called at the time of declaration of an object.'),
(38, 'Which of the following is correct about function overloading?', 'The types of arguments are different', 'The order of argument is different.', 'The number of argument is same.', 'Both A and B.', 'Both A and B.'),
(39, 'Which of the following is correct about class and structure?', 'class can have member functions while structure cannot.', 'class data members are public by default while that of structure are private.', 'Pointer to structure or classes cannot be declared.', 'class data members are private by default while that of structure are public by default.', 'class data members are private by default while that of structure are public by default.'),
(40, 'Which of the following concepts means waiting until runtime to determine which function to call?', 'Data hiding', 'Dynamic loading', 'Dynamic binding', 'Dynamic casting', 'Dynamic binding'),
(41, 'How "Late binding" is implemented in C++?', 'Using C++ tables', 'Using Virtual tables', 'Using Indexed virtual tables', 'Using polymorphic tables', 'Using Virtual tables'),
(42, '\r\nWhich of the following is the correct class of the object cout?\r\n', 'iostream', 'istream', 'ostream', 'ifstream', 'ostream'),
(43, 'Which of the following cannot be used with the keyword virtual?', 'class', 'member function', 'constructor', 'destructor', 'constructor'),
(44, 'Which of the following functions are performed by a constructor?', 'Construct a new class', 'Construct a new object', 'Construct a new function', 'initialize object', 'initialize object'),
(45, 'Which one of the following options is correct about the statement given below? The compiler checks the type of reference in the object and not the type of object.', 'Inheritance', 'Polymorphism', 'Encapsulation', 'Abstraction', 'Polymorphism'),
(46, 'Which of the following is the correct way of declaring a function as constant?', 'const int ShowData(void) { /* statements */ }', 'int const ShowData(void) { /* statements */ }', 'int ShowData(void) const { /* statements */ }', 'Both A and B', 'int ShowData(void) const { /* statements */ }'),
(47, 'Which of the following concepts is used to implement late binding?', 'Virtual function', 'Operator function', 'Const function', 'Static function', 'Virtual function'),
(48, 'Which of the following factors supports the statement that reusability is a desirable feature of a language?', 'It decreases the testing time.', 'It lowers the maintenance cost.		', 'It reduces the compilation time.', 'Both A and B', 'Both A and B'),
(49, 'Which of the following ways are legal to access a class data member using this pointer?', 'this->x', 'this.x', '*this->x', '*this.x', 'this->x'),
(50, 'Which of the following is a mechanism of static polymorphism?', 'Operator overloading', 'Function overloading', 'templates', 'All the above', 'All the above'),
(51, 'Which of the following is correct about the statements given below?\r\nI.	All operators can be overloaded in C++.\r\nII. We can change the basic meaning of an operator in C++.\r\n', 'Only I is true.', 'Both I and II are false.', 'Only II is true.', 'Both I and II are true', 'Both I and II are false.'),
(52, 'What happens if the base and derived class contains definition of a function with same prototype?', 'Compiler reports an error on compilation.', 'Only base class function will get called irrespective of object.', 'Only derived class function will get called irrespective of object.', 'Base class object will call base class function and derived class object will call derived class function.', 'Base class object will call base class function and derived class object will call derived class function.'),
(53, 'Which of the following are available only in the class hierarchy chain?', 'Public data members', 'Private data members', 'Protected data members', 'Member Functions', 'Protected data members'),
